script:
reset();

const size = 24;
const maxTerrainHeight = 16;
const maxHeight = 80;
// const seed = Math.floor(Math.random() * (2 ** 32));
// console.log(`seed: ${seed}`);
const seed = 1985 / 28029;
const simplex = new SimplexNoise(seed);

const map = new Uint8Array(size * maxHeight * size);

[
  [{ x: size * -0.5, z: size * -0.5 }, 60, 0],
  [{ x: size * -0.5 + 32, z: size * -0.5 - 32 }, 50, 1],
  [{ x: size * -0.5, z: size * -0.5 - 64 }, 40, 0],
  [{ x: size * -0.5 - 32, z: size * -0.5 - 48 }, 50, 2],
].forEach(([ origin, terrainY, light ]) => {
map.fill(0);

const trunk = 3;
const leaves = 2;
const voxelNeighbors = [
  { x: 1, y: 0, z: 0 },
  { x: -1, y: 0, z: 0 },
  { x: 0, y: 0, z: 1 },
  { x: 0, y: 0, z: -1 },
  { x: 0, y: 1, z: 0 },
  { x: 0, y: -1, z: 0 },
];
const tree = (
  position,
  height,
  radius
) => {
  const branches = height + radius * 0.5;
  const queue = [position];
  while (queue.length) {
    const {
      x,
      y,
      z,
      distance = 0,
    } = queue.shift();
    if (y < 0 || y >= maxHeight) {
      return;
    }
    const isTrunk = distance < height;
    map[x * size * maxHeight + y * size + z] = 2;
    update(origin.x + x, y, origin.z + z, (isTrunk || distance < branches) ? trunk : leaves);
    const pushNeighbor = (offset) => {
      const nx = x + offset.x;
      const ny = y + offset.y;
      const nz = z + offset.z;
      if (
        nx >= 0 && nx < size
        && nz >= 0 && nz < size
        && !map[nx * size * maxHeight + ny * size + nz]
      ) {
        queue.push({
          x: nx,
          y: ny,
          z: nz,
          distance: distance + 1,
        });
        return true;
      }
      return false;
    };
    if (isTrunk) {
      pushNeighbor({ x: 0, y: 1, z: 0 });
    } else if (distance === height) {
      voxelNeighbors.forEach((offset) => {
        if (offset.y !== -1) {
          pushNeighbor(offset);
        }
      });
    } else if (distance < (height + radius)) {
      let count = 0;
      const neighbors = voxelNeighbors.length;
      for (let i = 0; i < neighbors; i += 1) {
        const neighbor = voxelNeighbors[
          Math.floor(
            Math.abs(simplex.noise3D((x + i) * 2, (y - i) / 2, (z + i) * 2)) * neighbors
          )
        ];
        if (pushNeighbor(neighbor)) {
          count += 1;
          if (count >= 2) {
            break;
          }
        }
      }
    }
  }
};

const center = size * 0.5 - 0.5;
const radius = size * 0.5;
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxTerrainHeight + 1; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const d = Math.sqrt((center - x) ** 2 + (center - z) ** 2);
      if (d >= radius) {
        continue;
      }
      const height = 1 + Math.floor(
       (
          Math.abs(simplex.noise3D(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(simplex.noise3D(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(simplex.noise3D(x / 128, y / 64, z / 128)) * 0.4
        ) * maxTerrainHeight
      );
      map[x * size * maxHeight + (terrainY - 10 + y) * size + z] = y < height ? 1 : 0;
    }
  }
}

for (let x = 0; x < size; x += 1) {
  for (let z = 0; z < size; z += 1) {
    for (let y = 0; y < maxHeight; y += 1) {
      const d = Math.sqrt((center - x) ** 2 + (center - z) ** 2);
      if (d >= radius) {
        continue;
      }
      if (y < terrainY - 10) {
        const h = Math.min(terrainY, 24) * Math.exp(
          -((center - x) ** 2 + (center - z) ** 2) / (size * 2)
        );
        if (((terrainY - 10) - y) < h) {
          update(origin.x + x, y, origin.z + z, 4);
        }
        continue;
      }
      if (map[x * size * maxHeight + y * size + z] === 1) {
        const top = (
          y === (maxHeight - 1)
          || !map[
            x * size * maxHeight + (y + 1) * size + z
          ]
        );
        const type = top ? 1 : 4;
        if (top && y > 2 && simplex.noise3D(x / 8, y / 4, z / 8) > 0.6) {
          const n = Math.abs(simplex.noise2D(z / 8, x / 8));
          if (simplex.noise3D(y / 8, x / 4, z / 8) > -0.5) {
            update(origin.x + x, y + 1, origin.z + z, n > 0.1 ? 5 : 8 + light);
          } else {
            const n = Math.abs(simplex.noise2D(z / 8, x / 8));
            const h = 5 + Math.floor(Math.abs(simplex.noise2D(x / 2, z / 2)) * 8);
            const r = 7 + Math.floor(n * h * 0.5);
            tree({x, y, z}, h, r);
          }
        }
        update(origin.x + x, y, origin.z + z, type);
      }
    }
  }
}

});

const platform = {
  x: -41,
  y: 42,
  z: -57,
};
box(
  platform.x, platform.y, platform.z,
  12, 2, 12,
  6
);
box(
  platform.x + 1, platform.y, platform.z + 1,
  10, 1, 10,
  7
);
box(
  platform.x + 1, platform.y + 1, platform.z + 1,
  10, 4, 10,
  0
);

const elevators = [
  {
    x: -4,
    y: 55,
    z: 1,
  },
];
elevators.forEach(({ x, y, z }) => {
  box(
    x, y - 6, z,
    8, 13, 8,
    6
  );
  box(
    x + 1, y - 1, z + 1,
    6, 7, 6,
    11
  );
  box(
    x + 2, y, z + 2,
    4, 5, 4,
    0
  );
  box(
    x + 2, y, z - 1,
    4, 5, 1,
    7
  );
  box(
    x + 3, y, z - 1,
    2, 4, 3,
    0
  );
});
